// ==UserScript==
// @name         长春大学原神校区
// @namespace    http://tampermonkey.net/
// @version      0.5
// @description  把学校的官网改成原神吧
// @author       Le_le
// @match        *://*www.ccu.edu.cn/*
// @match        *://*.ccu.edu.cn/*
// @match        http://121.43.33.137/ccdx_genshin/
// @icon         https://www.google.com/s2/favicons?sz=64&domain=ccu.edu.cn
// @grant        GM_registerMenuCommand
// @grant        GM_setValue
// @grant        GM_getValue
// @run-at       document-end
// @downloadURL https://update.greasyfork.org/scripts/474064/%E9%95%BF%E6%98%A5%E5%A4%A7%E5%AD%A6%E5%8E%9F%E7%A5%9E%E6%A0%A1%E5%8C%BA.user.js
// @updateURL https://update.greasyfork.org/scripts/474064/%E9%95%BF%E6%98%A5%E5%A4%A7%E5%AD%A6%E5%8E%9F%E7%A5%9E%E6%A0%A1%E5%8C%BA.meta.js
// ==/UserScript==
const logo_png = "data:image/png;base64,";
const bg_img = "data:image/jpeg;base64,";
const naxida = "data:image/png;base64,";
(function () {
    'use strict';
    GM_registerMenuCommand('设置插件', open_setting);
    GM_registerMenuCommand('原神，启动！', genshinLaunch);
    var url = window.location.href;
    console.log(url);
    if (url == "https://www.ccu.edu.cn/" || url == "https://www.ccu.edu.cn/index.htm") {
        // 修改页面标题
        change_index();
    }
    if (url.includes("rz.webvpn.ccu.edu.cn/cas/login")) {
        // 修改页面标题
        change_login();
    }
    if (url == "http://121.43.33.137/ccdx_genshin/")
        change_setting();
})();
function change_index() {
    document.title = "长春大学原神校区欢迎您！";
    // 寻找class为"logo"的元素
    var logo = document.getElementsByClassName("logo");
    logo[0].src = logo_png;
    logo[0].style.width = "5rem";
    // 获取第一个swiper-wrapper
    var swiper_wrapper = document.getElementsByClassName("swiper-wrapper")[0];
    // 获取img标签
    var img = swiper_wrapper.getElementsByTagName("img");
    for (var i = 0; i < img.length; i += 1) {
        img[i].src = "https://img.moehu.org/pic.php?id=ys&rnd=" + Math.random();
        img[i].style.objectFit = "contain";
    }
    swiper_wrapper=document.getElementsByClassName("swiper1")[0];
    img = swiper_wrapper.getElementsByTagName("img");
    for (var i = 0; i < img.length; i += 1) {

        img[i].src = "https://img.moehu.org/pic.php?id=chiro&rnd=" + Math.random();
        img[i].style.objectFit = "contain";
    }
    // 寻找class为"nav"的元素
    var nav = document.getElementsByClassName("nav");
    var div = nav[0].getElementsByTagName("div")[0];
    var p = div.getElementsByTagName("p")[0];
    var new_p = document.createElement("p");
    new_p.innerHTML = "原神，启动！";
    new_p.style.cursor = "pointer";
    div.insertBefore(new_p, p);
    // 监听点击事件
    new_p.onclick = genshinLaunch;
}
function change_login() {
    // 寻找section标签
    var section = document.getElementsByClassName("section")[0];
    section.style.backgroundImage = "url(" + bg_img + ")";
    section.style.backgroundSize = "cover";
    section.style.backgroundPosition = "center";
    var login_from = document.getElementById("loginForm");
    login_from.style.background = "rgba(255,255,255,0.5)";
    login_from.style.backdropFilter = "blur(10px)";
    var login_title_text = document.getElementsByClassName("login_title_text")[0];
    login_title_text.innerHTML = "米哈游通行证登录";
    var footer = document.getElementsByClassName("footer")[0];
    // 删除footer
    footer.parentNode.removeChild(footer);
    setTimeout(() => {
        var username = document.getElementById("username");
        var password = document.getElementById("password");
        var gm_username = GM_getValue("webvpnID", "");
        var gm_password = GM_getValue("webvpnPWD", "");
        console.log("尝试自动填写密码");
        if (gm_username != "" && gm_password != "") {
            username.value = gm_username;
            password.value = gm_password;
            console.log("已自动填写密码");
            show_toast();
        }

    }, 1000);
}
function open_setting() {
    // 打开新的标签页
    window.open("http://121.43.33.137/ccdx_genshin/", "_blank");
}
function change_setting() {
    var webvpnID = GM_getValue("webvpnID", "");
    var webvpnPWD = GM_getValue("webvpnPWD", "");
    var ID = GM_getValue("ID", "");
    var PWD = GM_getValue("PWD", "");
    var webvpnID_input = document.getElementById("webvpnID");
    var webvpnPWD_input = document.getElementById("webvpnPWD");
    var ID_input = document.getElementById("ID");
    var PWD_input = document.getElementById("PWD");
    webvpnID_input.value = webvpnID;
    webvpnPWD_input.value = webvpnPWD;
    ID_input.value = ID;
    PWD_input.value = PWD;
    if (webvpnID == "" && webvpnPWD == "" && ID == "" && PWD == "") {
        alert("没有已保存的密码");
    }
    var save = document.getElementById("save");
    save.onclick = function () {
        var webvpnID = document.getElementById("webvpnID").value;
        var webvpnPWD = document.getElementById("webvpnPWD").value;
        var ID = document.getElementById("ID").value;
        var PWD = document.getElementById("PWD").value;
        GM_setValue("webvpnID", webvpnID);
        GM_setValue("webvpnPWD", webvpnPWD);
        GM_setValue("ID", ID);
        GM_setValue("PWD", PWD);
        alert("保存成功！");
    }
}
function show_toast() {
    var toast = document.createElement("img");
    toast.src = naxida;
    toast.style.position = "fixed";
    // 左下角
    toast.style.left = "0";
    toast.style.bottom = "0";
    toast.style.zIndex = "999";
    // 添加到body
    document.body.appendChild(toast);

}
function genshinLaunch() {
    // 原神，启动！
    // CSS
    const elm_style = document.createElement("style");
    elm_style.innerHTML = `
                    :root{
                        --img0: url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAIAAACQd1PeAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAAFiUAABYlAUlSJPAAAAAMSURBVBhXY/j//z8ABf4C/qc1gYQAAAAASUVORK5CYII=');
                        --img1: url('data:image/jpeg;base64,');
                        --img2: url('data:image/jpeg;base64,');
                        --img3: url('data:image/jpeg;base64,');
                    }

                    #genshinLaunch {
                        display: block;
                        position: fixed;
                        width: 100vw;
                        height: 100vh;
                        top: 0;
                        left: 0;
                        z-index: 1000000000;
                        background-size: contain;
                        background-position: center;
                        background-repeat: no-repeat;
                        background-color: #fff;
                        animation-name: launch;
                        animation-duration: 10s;
                        animation-fill-mode: forwards;
                    }
                    @keyframes launch {
                        30% {
                            background-image: var(--img0);
                        }
                        40% {
                            background-image: var(--img1);
                        }
                        50% {
                            background-image: var(--img2);
                        }
                        90% {
                            background-image: var(--img2);
                        }
                        100% {
                            background-image: var(--img3);
                        }
                    }
        `;
    document.head.appendChild(elm_style);

    // 启动音效
    const elm_audio = document.createElement("audio");
    elm_audio.style.display = "none";
    elm_audio.loop = true;
    elm_audio.src = "data:audio/mpeg;base64,";
    elm_audio.play();

    // 启动画面
    const elm_div = document.createElement("div");
    elm_div.id = "genshinLaunch";
    document.body.appendChild(elm_div);
    elm_div.requestFullscreen();

    // 起洞！
    setTimeout(() => {
        window.open("https://ys.mihoyo.com/main/");
        elm_div.onclick = () => {
            elm_audio.pause();
            elm_div.remove();
            elm_style.remove();
        }
    }, 12000)
}